summary:
6+ years experience working with large patient databases: Optum Clinformatics, California OSHPD (16 million), UK Biobank (0.5 million), National Inpatient Sample (NIS) database, NHANES database;
30+ high-quality publications in peer-reviewed journals including Gastroenterology, Gut and Lancet Gastroenterology & Hepatology (2750+ citations);
30+ oral and poster presentations at international conferences such as DDW, AASLD, and EASL;
Proficient in R, SAS, STATA, and SQL for data management and statistical analysis;
Rich experience in epidemiological study design, meta-analysis and analysis of observational studies using causal inference methods

projects.description:
• Conducted field research in a number of state-owned enterprises, holding panel meetings with the managers, and interviewing ordinary workers;
• Designed questionnaires concerning the social security system that ensures workers’ living quality, and study programs that promote workers’ skill development;
• Analyzed data from questionnaires and interviews, completed a 30-page report

• Conducted a two-week field research study in the labor-intensive factories of Shenzhen, giving out questionnaires at Foxconn, and interviewing female workers between ages 16 and 25;
• Completed a 10,000-word report on female migrant workers’ awareness of reproductive health, including literary review and questionnaire analysis;
• Filmed a documentary about a female migrant worker who later became a leader of a local NGO
